


package Com.Loops;

public class PrintNo {
	public  void Numbers(int i)
	{
		while(i<=99)
		{
			i++;
			System.out.println(i);
			}
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
     int i=1;
     PrintNo objNo=new PrintNo();
	    objNo.Numbers(i);
	}

}
